import React, {Component} from 'react';
import {BrowserRouter, Route, Switch, Link} from "react-router-dom";
import {PATH_ABOUT, PATH_CONTACT, PATH_FOR_DEVELOPERS, PATH_GALLERY, PATH_MAIN} from "./config/configuration";
import AboutMe from "./Components/AboutMe";
import Gallery from "./Components/Gallery";
import Main from "./Components/Main";
import Contact from "./Components/Contact";
import ForDevelopers from "./Components/ForDevelopers";
import './App.css';
import Navigation from "./Components/Navigation";


class App extends Component {
    constructor(props) {
        super(props);
    }

    render() {
        return (
            <BrowserRouter>
                <Navigation/>
                <Switch>
                    <Route path={PATH_MAIN} exact render={() => {
                        return <Main/>
                    }}/>

                    <Route path={PATH_GALLERY} exact render={()=>{
                        return (<div>hello</div>)
                    }}/>

                    <Route path={PATH_ABOUT} exact render={() => {
                        return <AboutMe/>
                    }}/>

                    <Route path={PATH_CONTACT} exact render={() => {
                        return <Contact/>
                    }}/>

                    <Route path={PATH_FOR_DEVELOPERS} exact render={() => {
                        return <ForDevelopers/>
                    }}/>
                </Switch>
            </BrowserRouter>
        )
    }
}

export default App;
